import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import Topbar from '../navbar/Topbar';
import Navbar from '../navbar/Navbar';
import { Link } from 'react-router-dom';


const useStyles = makeStyles((theme) => ({
  root: {
    width: '100vw',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function ListDividers() {
  const classes = useStyles();

  return (
      <div style={{textAlign:'center'}}>
      <div style={{display: 'inline-block'}}>
      <br/>
    <List component="nav" className={classes.root} aria-label="mailbox folders">
      <Link to='/Profile' style={{textDecoration: 'none', color: 'inherit'}}><ListItem button>
        <ListItemText primary="Profile" />
      </ListItem></Link>
      <Divider />
      <Link to='/PastTrips' style={{textDecoration: 'none', color: 'inherit'}}><ListItem button>
        <ListItemText primary="Trips" />
      </ListItem></Link>
      <Divider light />
      <Link to='/ContactUs' style={{textDecoration: 'none', color: 'inherit'}}><ListItem button>
        <ListItemText primary="Contact Us" />
      </ListItem></Link>
      {this.props.currentUser.active ?   <>
      <Divider light />
        <ListItem button divider>
        <ListItemText primary="Upload Photos" />
      </ListItem>
      </> : ''}
    </List>
    </div>
   </div>
  );
}
